css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("enfull.com"),  domain("wznfo.com") {
#logo
,#wm_products
,#nav
,#footer #copyright
,#footer #flag
,#footer #policy
,.flink
,iframe
,.List
{display:none !important}


ul {background:#ffffff !important;}
li {border:0 !important; margin:15px 0 !important; background:#ffffff !important}
div.title {font:bold 12pt sans-serif !important; }
div.long {font:normal 8pt sans-serif !important; color:#d0d0d0 !important; top:-10px !important; position:relative !important}


input[name="keyword"]{width:40% !important; font:normal 2em sans-serif !important; padding:5px !important; }
input[type="submit"]{width:10% !important; font:normal 2em sans-serif !important; padding:4px !important; background:#ffcc00 !important}
input:hover{border:1px solid #ccff00 !important;}
#footer {padding-bottom:100px !important; background:#226CB9 !important}

}
